import React from "react";
import "./Navbar.css";
function Navbar() {
  return (
    <nav className="navBar">
      <img
        src="https://www.pinterest.com/pin/708824428844867530/"
        alt="error"
        className="navBar__logo"
      />
    </nav>
  );
}

export default Navbar;
